import React from "react";
import Table from 'react-bootstrap/Table';

export class Carros extends React.Component{
    
    constructor(props){
        super(props);

        this.state = {
            modelo: []
        }
    }

    render(){
        return(
            <Table>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Username</th>
                        </tr>
                </thead>

                <tbody>
                    <tr>
                        <td>1</td>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                    <tr>
                        <td>2</td>
                        <td>Jacob</td>
                        <td>Thornton</td>
                        <td>@fat</td>
                    </tr>
                    <tr>
                        <td>3</td>
                        <td></td>
          <td>@twitter</td>
        </tr>
      </tbody>
    </Table>
        )
        
    }
}
